-- Table structure for bsxf_check_history
-- ----------------------------
DROP TABLE IF EXISTS `bsxf_check_history`;
CREATE TABLE `bsxf_check_history` (
  `id` varchar(255) NOT NULL DEFAULT '' COMMENT 'ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '最后修改时间',
  `create_user_id` varchar(50) DEFAULT NULL COMMENT '创建人',
  `last_update_user_id` varchar(50) DEFAULT NULL COMMENT '最后修改人',
  `equipment_id` varchar(255) DEFAULT NULL COMMENT '关联设备id',
  `comments` varchar(255) DEFAULT NULL COMMENT '备注',
  `check_user_id` varchar(255) DEFAULT NULL COMMENT '巡检员',
  `check_time` datetime DEFAULT NULL COMMENT '巡检时间',
  `status` varchar(255) DEFAULT NULL COMMENT '有效状态（删除时更改）：enabled; disabled',
  `runStatus` varchar(255) DEFAULT NULL COMMENT '状态：1-正常工作；2-运行异常',
  `field01` varchar(50) DEFAULT NULL COMMENT '扩展字段01',
  `field02` varchar(50) DEFAULT NULL COMMENT '扩展字段02',
  `field03` varchar(50) DEFAULT NULL COMMENT '扩展字段03',
  `field04` varchar(50) DEFAULT NULL COMMENT '消防设施是否被遮挡，灭火器箱是否完好，灭火器数量是否缺少。',
  `field05` varchar(50) DEFAULT NULL COMMENT '灭火器的铭牌是否残缺，并清晰明了。',
  `field06` varchar(50) DEFAULT NULL COMMENT '灭火器上关于灭火剂、驱动气体的种类、充装压力、总质量、灭火级别、制造厂名和生产日期或维修日期等标志及操作说明是否齐全。',
  `field07` varchar(50) DEFAULT NULL COMMENT '灭火器的铅封、销闩等保险装置是否损坏。',
  `field08` varchar(50) DEFAULT NULL COMMENT '灭火器的筒体是否无明显的损伤（磕伤、划伤）、缺陷、锈蚀（特别是筒底和焊缝）、泄漏。',
  `field09` varchar(50) DEFAULT NULL COMMENT '灭火器的喷射软管是否完好，无明显龟裂，喷嘴不堵塞。',
  `field10` varchar(50) DEFAULT NULL COMMENT '灭火器的驱动气体压力是否在工作压力范围。',
  `field11` varchar(50) DEFAULT NULL COMMENT '灭火器的零部件是否齐全，并且无松动、脱落或损伤现象。',
  `field12` varchar(50) DEFAULT NULL COMMENT '水枪、水带、水管是否齐全，无破损，易连接。',
  `field13` varchar(50) DEFAULT NULL COMMENT '消火栓水压是否正常，启泵按钮是否有效。',
  `field14` varchar(50) DEFAULT NULL COMMENT '扩展字段11',
  PRIMARY KEY (`id`),
  KEY `equipment_id_index` (`equipment_id`),
  KEY `check_user_id_index` (`check_user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of bsxf_check_history
-- ----------------------------

