  `location` varchar(255) DEFAULT NULL COMMENT '位置',
  `amount` int(10) DEFAULT '0' COMMENT '数量',
  `comments` varchar(255) DEFAULT NULL COMMENT '详细描述',
  `status` varchar(255) DEFAULT NULL COMMENT '有效状态（删除时更改）：enabled; disabled',
  `runStatus` varchar(255) DEFAULT NULL COMMENT '状态：1-正常工作；2-运行异常',
  `productionDate` datetime DEFAULT NULL COMMENT '生产日期(设备1)',
  `productionDate2` datetime DEFAULT NULL COMMENT '生产日期(设备2)',
  `productionDate3` datetime DEFAULT NULL COMMENT '生产日期(设备3)',
