  `remainNum` int(11) DEFAULT NULL COMMENT '每月剩余巡检次数,在下个月时会将这个字段复制到lastremainNum字段，这个字段重置',
  `lastRemainNum` int(11) DEFAULT NULL COMMENT '上月剩余巡检次数',
  `check_user_id` varchar(50) DEFAULT NULL COMMENT '巡检负责人',
  `pointx` varchar(50) DEFAULT NULL COMMENT '经度',
  `pointy` varchar(50) DEFAULT NULL COMMENT '纬度',
  `field01` varchar(50) DEFAULT NULL COMMENT '扩展字段1',
  `field02` varchar(50) DEFAULT NULL COMMENT '扩展字段2',
  `field03` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field04` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field05` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field06` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field07` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field08` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field09` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field10` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field11` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field12` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field13` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  `field14` varchar(50) DEFAULT NULL COMMENT '扩展字段3',
  PRIMARY KEY (`id`),
  KEY `equipment_type_id_index` (`equipment_type_id`),
  KEY `eno_index` (`eno`)
